import React, { Component } from "react";

export class login extends Component {
  render() {
    return (
      <div>
        <style>{"body { background-color: #322F40; }"}</style>
        <h3 class="text-center" style={{ marginTop: "10rem", color: "white" }}>
          User Login
        </h3>
        <form class="col-lg-6 offset-lg-3">
          <div className="form-group">
            <label
              class="col-lg-6 offset-lg-3"
              style={{ marginTop: "1rem", color: "white" }}
            >
              Email:
            </label>
            <input type="text" class="col-lg-6 offset-lg-3 form-control" />
            <label
              class="col-lg-6 offset-lg-3"
              style={{ marginTop: "1rem", color: "white" }}
            >
              Password:
            </label>
            <input class="col-lg-6 offset-lg-3" />
          </div>
          <div className="form-group" class="text-center">
            <input type="submit" value="Login!" className="btn btn-primary" />
          </div>
        </form>
      </div>
    );
  }
}

export default login;
